    const [userData, setUserData] = useState("Loading...")

    useEffect(() => {
      dogFacade.getUser().then(data => setUserData(data.msg));
    }, []);

    return (
      <div>
        <h1>Hello! Just testing user!</h1>
        <h2>{userData}</h2>
      </div>
    );
  };

  export default User;
